import HomePageText from './HomePageText';
import ProfilePhoto from './Profile_Photo.jpg'
import { SplitScreen } from '../UtilComponents/SplitScreen';

const ProfilePhotoComponent = () => {
    return <img src= {ProfilePhoto} alt='ProfilePhoto' width = '100%' style = {{borderColor: black, borderWidth: 1}}/>
}


function HomePage() {
    return (
    <SplitScreen leftWeight = {1} rightWeight = {3}>
        <ProfilePhotoComponent/>
        <HomePageText/>
    </SplitScreen>)
}

export default HomePage;
